import { motion } from "framer-motion"
import estyle from "./MainContent.module.scss"

const MainContent = ({props}) => {


    const svgVariants = {
        ready: { opacity: 0,  scaleX:10, y:100 },
        start: { opacity: 1, scaleX:1, y:0, 
            transition: { 
                // opacity: { delay: props.delay1, duration: props.duration1 },
                // scale: { delay: props.delay2, duration: props.duration2 }

                opacity: { delay: 2.5, duration:.2, type:'tween', ease:'anticipate' },
                scaleX: { delay: 2.5, duration: .5, type:'tween', ease:'anticipate' },
                y: { delay:2.5, duration: .5, type: 'tween', ease:'anticipate' }
            }

            /*
             transition: {
                scale: { duration:props.duration1, type:'tween', ease:'anticipate' },
                y:{ delay:props.delay2, duration: props.duration2, type:'tween', ease:'anticipate'}
            }}

            */
        }
    }

    return (
        <div>
            <motion.div 
                className={estyle.maincontent}
                variants={svgVariants}
                initial="ready"
                animate="start"
            >

            </motion.div>
        </div>
    );
};

export default MainContent;
